import React from "react";
import { useNavigate } from "react-router-dom";

function HomePage() {
  const navigate = useNavigate();

  const handleAddShop = () => {
    navigate("/submit");
  };

  const handleViewShops = () => {
    navigate("/shops");
  };

  return (
    <div className="min-h-screen bg-gray-50 text-gray-800 px-6 py-12">
      <div className="max-w-3xl mx-auto">
        <div className="mb-8 flex flex-col gap-4">
          <button
            onClick={handleAddShop}
            className="bg-black text-white py-2 px-4 rounded hover:bg-gray-800 transition"
          >
            Add a Barbershop
          </button>
          <button
            onClick={handleViewShops}
            className="bg-black text-white py-2 px-4 rounded hover:bg-gray-800 transition"
          >
            View All Shops
          </button>
        </div>

        <div className="mt-12">
          <h2 className="text-2xl font-bold mb-4">Why The Fade?</h2>
          <p className="mb-2">
            Barbershops are more than businesses. But finding the right one in a
            new place can be hard — until now.
          </p>
          <p className="mb-2">
            <strong>The Fade</strong> is a living archive of barbers who
            understand Black hair — from tight coils to clean tapers.
          </p>
          <p className="text-sm text-gray-600">
            All listings are reviewed for accuracy, and barbers can request
            updates anytime.
          </p>
        </div>
      </div>
    </div>
  );
}

export default HomePage;
